In the days of commercial Babylon, there will be a devastation of riches within a single hour. So too, man's riches of today are made vanity. Grab your Bible and join our continued study through REVELATION. At the end of the day, what really counts? We aim to fear God, and trust in Him.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
